import React from "react";
import "./formSelect.css";

export default function FormSelect(props) {

    return (
        <>
        <label>Escolha o Pais Que Deseja Pesquisar!!</label>
        <div>
            <select>
            <option>canada</option>
            <option>brasil</option>
            <option>chile</option>
            </select>

            <button>Pesquisar</button>
        </div>
        </>
    )
}
